import React from 'react';
import {View, Image, Text, StyleSheet} from 'react-native';

export default function postCard(props){
    return (
        <View style={styles.card}>
            <Text>Test</Text>
        </View>
    )
}

const styles=StyleSheet.create({
    card:{
        flex:1,
        alignItems:"center",
        padding:16,
        borderRadius:4,
        backgroundColor:"#FFF",
        shadowColor:"#000",
        shadowOpacity:"0.5",
        shadowRadius:"10",
        shadowOffset:{width:10,height:10},
    }
})
